import React, { useEffect } from "react";
import { useParams } from "react-router-dom";
import axiosInstance from "../../baseurl";

function Chat() {
  const { id } = useParams();

  useEffect(() => {
    axiosInstance
      .post(`/createChat`, {
        cid: localStorage.getItem("CustomerLogId"),
        drid: id,
      })
      .then((res) => {
        console.log(res, "create chat");
      })
      .catch((err) => {
        console.log(err);
      });

    axiosInstance
      .post(`/viewChatForDrwithCust/${id}`, {
        cid: localStorage.getItem("CustomerLogId"),
      })
      .then((res) => {
        console.log(res, "view chat");
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);
  return <div>
    <div className="chatdiv"></div>
  </div>;
}

export default Chat;
